import React from 'react';
import { Link } from 'react-router-dom';
import '../style/Footer.css';
import logo from '../images/Logo.png';
import facebookIcon from '../images/facebook.png';
import twitterIcon from '../images/twitter.png';
import instagramIcon from '../images/instagram.png';
import whatsappIcon from '../images/whatsapp.png';

const Footer = () => {
  return (
    <footer className="footer-container">
      <div className="assistance-section">
        <h3>Need Assistance?</h3>
        <input type="email" placeholder="Enter your email" />
        <button className="send-email-btn">Send Email</button>
      </div>
      <div className="footer-content">
        <div className="footer-left">
          <img src={logo} alt="BakeHub Logo" className="footer-logo" />
          <p className="footer-title">BakeHub</p>
          <p className="footer-subtitle">Trusted Bakery in Town.</p>
          <p className="contact-title">Contact Us</p>
          <p className="contact-info">
            <span className="contact-icon">üè†</span> Bhaktapur, Nepal<br />
            <span className="contact-icon">üìû</span> +977 9841000000
          </p>
          <div className="social-icons">
            <a href="https://facebook.com"><img src={facebookIcon} alt="Facebook" /></a>
            <a href="https://twitter.com"><img src={twitterIcon} alt="Twitter" /></a>
            <a href="https://instagram.com"><img src={instagramIcon} alt="Instagram" /></a>
            <a href="https://whatsapp.com"><img src={whatsappIcon} alt="WhatsApp" /></a>
          </div>
        </div>
        <div className="footer-middle">
          <p className="footer-heading">Categories</p>
          <Link to="/faq" className="footer-link">FAQ</Link>
        </div>
        <div className="footer-right">
          <p className="footer-heading">Terms and Conditions</p>
          <Link to="/privacy-policy" className="footer-link">Privacy Policy</Link>
          <Link to="/about-us" className="footer-link">About Us</Link>
        </div>
      </div>
      <div className="footer-bottom">
        <p>Terms | Privacy | CCPA | Copyright | Legal | ¬© BakeHub</p>
      </div>
    </footer>
  );
};

export default Footer;
